import axios from "axios";
const baseUrl = "http://localhost:3001/notes";

const initialGet = () => {
  axios.get(baseUrl);
};

const postNew = obj => {
  axios.post(baseUrl, obj);
};

const toggleImportant = (id, obj) => {
  axios.put(`baseUrl/${id}`);
};

export { initialGet, postNew, toggleImportant };
